column2:
[TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": [
      "Adversaries may attempt to position themselves between two or more networked devices using an adversary-in-the-middle (AiTM) technique to support follow-on behaviors such as Network Sniffing, Transmitted Data Manipulation, or replay attacks (Exploitation for Credential Access)"
    ],
    "Explanation": "The Snort rule detects an SMB attack attempt by the Responder tool, which performs an AiTM attack by poisoning the NetBIOS Name Service (NBT-NS) to redirect traffic and capture credentials."
  },
  {
    "sid": "50106",
    "Technique ID": "T1595",
    "Technique name": "Active Scanning",
    "Quotes": [
      "Adversaries may execute active reconnaissance scans to gather information that can be used during targeting"
    ],
    "Explanation": "The Responder tool performs active scanning by sending spoofed NBT-NS responses to trigger authentication attempts, which can be used to capture credentials."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1558",
    "Technique name": "Steal or Forge Kerberos Tickets",
    "Quotes": [
      "Adversaries may attempt to subvert Kerberos authentication by stealing or forging Kerberos tickets to enable Pass the Ticket"
    ],
    "Explanation": "The Snort rule detects an attempt to perform a Responder poisoner SMB attack, which is a technique used to steal or forge Kerberos tickets for the purpose of enabling Pass the Ticket attacks."
  },
  {
    "sid": "50106",
    "Technique ID": "T1528",
    "Technique name": "Steal Application Access Token",
    "Quotes": [
      "Adversaries can steal application access tokens as a means of acquiring credentials to access remote systems and resources"
    ],
    "Explanation": "The Responder poisoner SMB attack detected by the Snort rule could potentially be used to steal application access tokens, which could then be used to access remote systems and resources."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1078",
    "Technique name": "Valid Accounts",
    "Quotes": [
      "Adversaries may obtain and abuse credentials of existing accounts as a means of gaining Initial Access, Persistence, Privilege Escalation, or Defense Evasion"
    ],
    "Explanation": "The Snort rule is designed to detect a SMB attack attempt known as 'Responder poisoner', which involves capturing and abusing valid credentials from the network traffic. This aligns with the 'Valid Accounts' technique, where adversaries obtain and abuse existing account credentials."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1585",
    "Technique name": "Establish Accounts",
    "Quotes": [
      "Adversaries may compromise accounts with services that can be used during targeting"
    ],
    "Explanation": "The Snort rule detects an attempt to perform an SMB attack using the Responder tool, which can be used to capture credentials and potentially establish accounts on the targeted system."
  },
  {
    "sid": "50106",
    "Technique ID": "T1003",
    "Technique name": "Credential Dumping",
    "Quotes": [
      "Adversaries may attempt to dump credentials to obtain account login and credential material, normally in the form of a hash or a clear text password, from the operating system and software."
    ],
    "Explanation": "The Responder tool used in the detected attack can capture credentials, which is a form of credential dumping. The captured credentials can then be used for further exploitation or lateral movement."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1555",
    "Technique name": "Credentials from Password Stores",
    "Quotes": ["'Adversaries may search for common password storage locations to obtain user credentials'"],
    "Explanation": "The Snort rule is designed to detect a Responder poisoner SMB attack attempt, which is a technique used to obtain credentials from password stores on the network. The rule looks for specific content in the network traffic that is indicative of this type of attack."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1499",
    "Technique name": "Endpoint Denial of Service",
    "Quotes": [
      "Adversaries may perform Endpoint Denial of Service (DoS) attacks to degrade or block the availability of services to users"
    ],
    "Explanation": "The Snort rule is designed to detect a SMB attack attempt known as 'Responder poisoner', which is a type of Denial of Service (DoS) attack targeting the SMB protocol on Windows systems. This aligns with the T1499 technique, which involves adversaries performing Endpoint DoS attacks to disrupt the availability of services."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1190",
    "Technique name": "Exploit Public-Facing Application",
    "Quotes": [
      "Adversaries may attempt to exploit a weakness in an Internet-facing host or system to initially access a network"
    ],
    "Explanation": "The Snort rule is designed to detect a SMB attack attempt, which is an attempt to exploit a public-facing service (SMB) to gain initial access to the network."
  },
  {
    "sid": "50106",
    "Technique ID": "T1210",
    "Technique name": "Exploitation of Remote Services",
    "Quotes": [
      "Adversaries may exploit remote services to gain unauthorized access to internal systems once inside of a network"
    ],
    "Explanation": "The Snort rule is detecting an attempt to exploit the SMB remote service, which could potentially allow an adversary to gain unauthorized access to internal systems after gaining initial access."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique Name": "Adversary-in-the-Middle",
    "Quotes": ["Adversaries may attempt to hijack communication channels between two networks, systems, or nodes to insert themselves as a man-in-the-middle."],
    "Explanation": "The Snort rule detects an attempt to perform a Responder poisoner SMB attack, which is a type of adversary-in-the-middle attack where the adversary intercepts and responds to SMB traffic before the legitimate server, allowing them to capture credentials or deliver malicious payloads."
  },
  {
    "sid": "50106",
    "Technique ID": "T1003",
    "Technique Name": "Credential Dumping",
    "Quotes": ["Adversaries may attempt to dump credentials to obtain account login and credential material, normally in the form of a hash or a clear text password, from the operating system and software."],
    "Explanation": "The Responder poisoner SMB attack aims to capture credentials, such as hashed passwords, from the targeted systems by responding to SMB traffic before the legitimate server. This aligns with the Credential Dumping technique, where adversaries attempt to obtain credential material from the compromised systems."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1556",
    "Technique name": "Modify Authentication Process",
    "Quotes": [
      "Adversaries may modify authentication mechanisms and processes to access user credentials or enable otherwise unwarranted access to accounts"
    ],
    "Explanation": "The Snort rule detects an attempt to perform a Responder poisoner SMB attack, which is a technique used to modify the authentication process and capture user credentials by poisoning the SMB protocol."
  },
  {
    "sid": "50106",
    "Technique ID": "T1040",
    "Technique name": "Network Sniffing",
    "Quotes": [
      "Adversaries may sniff network traffic to capture information about an environment, including authentication material passed over the network"
    ],
    "Explanation": "The Responder poisoner SMB attack involves sniffing network traffic to capture authentication material (such as user credentials) passed over the network during the SMB authentication process."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1557",
    "Technique name": "Adversary-in-the-Middle",
    "Quotes": [
      "Adversaries may attempt to insert themselves into communication channels between two legitimate hosts to gain access to data flows."
    ],
    "Explanation": "The Snort rule is designed to detect a Responder poisoner SMB attack attempt, which is a type of Adversary-in-the-Middle attack where the adversary attempts to intercept and respond to SMB traffic before the legitimate server, allowing them to gain access to the communication channel."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "50106",
    "Technique ID": "T1505",
    "Technique name": "Server Software Component",
    "Quotes": [
      "Adversaries may abuse legitimate extensible development features of servers to establish persistent access to systems"
    ],
    "Explanation": "The Snort rule detects an attempt to exploit the Responder tool, which is a LLMNR/NBT-NS/mDNS poisoner that can be used to gain persistent access on systems by abusing the Server Message Block (SMB) protocol, which is a server software component."
  },
  {
    "sid": "50106",
    "Technique ID": "T1021",
    "Technique name": "Remote Services",
    "Quotes": [
      "Adversaries may use Valid Accounts to log into a service that accepts remote connections, such as telnet, SSH, and VNC"
    ],
    "Explanation": "The Snort rule is detecting an attempt to exploit the SMB protocol, which is a remote service that allows remote connections to file shares and other resources on a system."
  }
]', type='text')]

[TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1595",
    "Technique Name": "Active Scanning",
    "Quotes": [
      "Adversaries may execute active reconnaissance scans to gather information that can be used during targeting"
    ],
    "Explanation": "The Snort rule is detecting access to the '/login.htm' URI, which could be an attempt by an adversary to actively scan for login pages as part of reconnaissance activities."
  },
  {
    "sid": "1564", 
    "Technique ID": "T1071",
    "Technique Name": "Application Layer Protocol",
    "Quotes": [
      "Adversaries may communicate using OSI application layer protocols to avoid detection/network filtering by blending in with existing traffic"
    ],
    "Explanation": "The Snort rule is monitoring HTTP traffic, which is an application layer protocol. An adversary could use HTTP to blend in with legitimate traffic during reconnaissance or other activities."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1539",
    "Technique name": "Steal Web Session Cookie",
    "Quotes": [
      "An adversary may steal web application or service session cookies and use them to gain access to web applications or Internet services as an authenticated user without needing credentials"
    ],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI, which is likely a login page for a web application. By monitoring for this activity, the rule may be able to detect attempts by an adversary to steal web session cookies, which could allow them to gain unauthorized access to the web application as an authenticated user."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1102",
    "Technique name": "Web Service",
    "Quotes": ["Adversaries may use an existing, legitimate external Web service as a means for relaying data to/from a compromised system"],
    "Explanation": "The Snort rule is detecting access to the '/login.htm' URI on HTTP servers, which could be an attempt by an adversary to use a web service for malicious purposes, such as relaying data or commands to a compromised system."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1185",
    "Technique name": "Browser Session Hijacking",
    "Quotes": [
      "Adversaries may take advantage of security vulnerabilities and inherent functionality in browser software to change content, modify user-behaviors, and intercept information as part of various browser session hijacking techniques"
    ],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI, which could be an attempt to hijack a user's browser session by exploiting vulnerabilities or functionality in the web application's login page."
  },
  {
    "sid": "1564", 
    "Technique ID": "T1059",
    "Technique name": "Command and Scripting Interpreter",
    "Quotes": [
      "Adversaries may abuse command and script interpreters to execute commands, scripts, or binaries"
    ],
    "Explanation": "While the Snort rule does not directly detect command execution, a successful session hijacking attack could potentially lead to an adversary abusing command and scripting interpreters on the compromised system."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1213",
    "Technique name": "Data from Information Repositories",
    "Quotes": ["Adversaries may leverage information repositories to mine valuable information"],
    "Explanation": "The Snort rule is detecting access to the /login.htm page, which is likely an authentication page for a web application. An adversary could be attempting to mine credentials or other sensitive information from this information repository."
  },
  {
    "sid": "1564", 
    "Technique ID": "T1030",
    "Technique name": "Data Transfer Size Limits",
    "Quotes": ["An adversary may exfiltrate data in fixed size chunks instead of whole files or limit packet sizes below certain thresholds"],
    "Explanation": "While the Snort rule does not directly relate to data exfiltration, an adversary who successfully accesses the /login.htm page may attempt to exfiltrate data, potentially using techniques like limiting transfer sizes to evade detection."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1189",
    "Technique name": "Drive-by Compromise",
    "Quotes": [
      "Adversaries may gain access to a system through a user visiting a website over the normal course of browsing"
    ],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI on web servers, which could potentially be an attempt by an adversary to compromise the system through a drive-by attack on a website visited by a user."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1190",
    "Technique name": "Exploit Public-Facing Application",
    "Quotes": [
      "Adversaries may attempt to exploit a weakness in an Internet-facing host or system to initially access a network"
    ],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI on public-facing web servers, which could indicate an attempt to exploit a vulnerability in the login page to gain initial access to the network."
  },
  {
    "sid": "1564", 
    "Technique ID": "T1212",
    "Technique name": "Exploitation for Credential Access",
    "Quotes": [
      "Adversaries may exploit software vulnerabilities in an attempt to collect credentials"
    ],
    "Explanation": "The Snort rule is specifically looking for access to the login page ('/login.htm'), which could be an attempt to exploit a vulnerability in the login mechanism to steal credentials."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1071",
    "Technique Name": "Application Layer Protocol",
    "Quotes": [
      "Adversaries may abuse application layer protocols to obfuscate command and control traffic or bypass filtering rules."
    ],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI, which is typically associated with web application login pages. This could be an indicator of an adversary attempting to abuse the HTTP protocol for malicious purposes, such as command and control or unauthorized access."
  },
  {
    "sid": "1564",
    "Technique ID": "T1190",
    "Technique Name": "Exploit Public-Facing Application",
    "Quotes": [
      "Adversaries may attempt to take advantage of a weakness in an Internet-facing computer or program to gain access to the system."
    ],
    "Explanation": "The Snort rule is monitoring for access to a specific URI ('/login.htm') on public-facing web servers. This could be an indication of an adversary attempting to exploit a vulnerability in a public-facing web application to gain unauthorized access or conduct other malicious activities."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1046",
    "Technique name": "Network Service Discovery",
    "Quotes": [
      "Adversaries may attempt to get a listing of services running on remote hosts and local network infrastructure devices, including those that may be vulnerable to remote software exploitation"
    ],
    "Explanation": "The Snort rule is designed to detect access to the '/login.htm' URI on HTTP servers, which suggests an attempt to discover and potentially exploit a web application login service running on the target system."
  },
  {
    "sid": "1564",
    "Technique ID": "T1106",
    "Technique name": "Native API",
    "Quotes": [
      "Adversaries may interact with the native OS application programming interface (API) to execute behaviors"
    ],
    "Explanation": "The Snort rule is monitoring for access to a web application login page, which likely involves interacting with the native web server API or application programming interfaces (APIs) provided by the operating system or web server software."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1190",
    "Technique Name": "Exploit Public-Facing Application",
    "Quotes": [
      "Adversaries may attempt to take advantage of a weakness in an Internet-facing computer or program using software, data, or commands in order to cause unintended or unanticipated behavior."
    ],
    "Explanation": "The Snort rule is designed to detect attempts to access the '/login.htm' page on web servers, which could be an indication of an adversary trying to exploit a public-facing web application for unauthorized access or other malicious purposes."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "1564",
    "Technique ID": "T1505",
    "Technique name": "Server Software Component",
    "Quotes": [
      "Adversaries may abuse legitimate extensible development features of servers to establish persistent access to systems"
    ],
    "Explanation": "The Snort rule is detecting access to the '/login.htm' URI on web servers, which could be an attempt by an adversary to abuse a server software component (e.g., a web application) to gain persistent access."
  }
]', type='text')]

[TextBlock(text='[
