[TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1020",
    "Technique name": "Automated Exfiltration",
    "Quotes": [
      "Adversaries may exfiltrate data, such as sensitive documents, through the use of automated processing after being gathered during Collection"
    ],
    "Explanation": "The Snort rule detects an attempt to exfiltrate data collected by a keylogger via email (SMTP). This aligns with the Automated Exfiltration technique, where data is automatically exfiltrated after being collected."
  },
  {
    "sid": "10088", 
    "Technique ID": "T1119",
    "Technique name": "Automated Collection",
    "Quotes": [
      "Once established within a system or network, an adversary may use automated techniques for collecting internal data"
    ],
    "Explanation": "The Snort rule detects the exfiltration of data collected by a keylogger, which is an automated technique for collecting internal data (keystrokes) from the compromised system."
  },
  {
    "sid": "10088",
    "Technique ID": "T1123",
    "Technique name": "Audio Capture",
    "Quotes": [
      "An adversary can leverage a computer's peripheral devices (e"
    ],
    "Explanation": "While the technique description is incomplete, a keylogger is a type of peripheral device that can be used to capture user input, which aligns with the Audio Capture technique."
  }
]', type='text')][TextBlock(text='[
  {
    "sid": "10088",
    "Technique ID": "T1528",
    "Technique name": "Steal Application Access Token",
    "Quotes": [
      "Adversaries can steal application access tokens as a means of acquiring credentials to access remote systems and resources"
